(546, 'Layout-aware text extraction from full-text <b>PDF </b>of scientific articles', 'https://link.springer.com/article/10.1186/1751-0473-7-7', 141, 'pdf', 'tes', 'The Portable Document Format (PDF) is the most commonly used file format for online scientific publications. The absence of effective means to extract text from these PDF files in a layout-aware manner presents a significant challenge for developers of biomedical text mining or biocuration informatics systems that use published literature as an information source. In this paper we introduce the ‘Layout-Aware PDF Text Extraction’ (LA-PDFText) system to facilitate accurate extraction of text from PDF files of research articles for use in text mining applications.'),
(547, 'Emotions and Bodily Changes. a Survey of Literature on Psychosomatic Interrelationships 1910&#8211;1933', 'https://www.degruyter.com/document/doi/10.7312/dunb91000/html?lang=de', 1921, 'pdf', 'tes', ''),
(548, 'Towards adversarial malware detection: Lessons learned from <b>PDF</b>-based attacks', 'https://dl.acm.org/doi/abs/10.1145/3332184', 53, 'pdf', 'tes', 'Malware still constitutes a major threat in the cybersecurity landscape, also due to the widespread use of infection vectors such as documents. These infection vectors hide embedded malicious code to the victim users, facilitating the use of social engineering techniques to infect their machines. Research showed that machine-learning algorithms provide effective detection mechanisms against such threats, but the existence of an arms race in adversarial settings has recently challenged such systems. In this work, we focus on malware embedded in PDF files as a representative case of such an arms race. We start by providing a comprehensive taxonomy of the different approaches used to generate PDF malware and of the corresponding learning-based detection systems. We then categorize threats specifically targeted against learning-based PDF malware detectors using a well-established framework in the field of adversarial machine learning. This framework allows us to categorize known vulnerabilities of learning-based PDF malware detectors and to identify novel attacks that may threaten such systems, along with the potential defense mechanisms that can mitigate the impact of such threats. We conclude the article by discussing how such findings highlight promising research directions towards tackling the more general challenge of designing robust malware detectors in adversarial settings.'),
(549, 'The <b>pdf </b>approach to turbulent flow', 'https://link.springer.com/article/10.1007/BF00271582', 122, 'pdf', 'tes', 'Probability density function (pdf) methods provide a complete statistical description of turbulent flow fields at a single point or a finite number of points. Turbulent convection and finite-rate chemistry can be treated in closed and exact form with pdfs in contrast to methods based on statistical moments. The equations for pdfs at a finite number of points are indeterminate due to molecular transport and pressure-gradient terms which require pdfs of higher order. The theoretical foundation of pdfs methods are developed in this paper starting from the exact and linear equations on the functional level. The closure problem for single-point pdf equations is treated in detail and several closure models are analyzed. Turbulent combustion at low Mach numbers constitutes an important area of application and selected results for a turbulent methane flame are presented as an example. The extension of pdf methods to supersonic turbulent flows with and without chemical reactions are outlined. Progress in the numerical solution of pdf equations is reviewed briefly. In the concluding remarks, both the advantages and disadvantages of pdf methods are evaluated.'),
