(556, 'Layout-aware text extraction from full-text <b>PDF </b>of scientific articles', 'https://link.springer.com/article/10.1186/1751-0473-7-7', 141, 'pdf', 'tes', 'The Portable Document Format (PDF) is the most commonly used file format for online scientific publications. The absence of effective means to extract text from these PDF files in a layout-aware manner presents a significant challenge for developers of biomedical text mining or biocuration informatics systems that use published literature as an information source. In this paper we introduce the ‘Layout-Aware PDF Text Extraction’ (LA-PDFText) system to facilitate accurate extraction of text from PDF files of research articles for use in text mining applications.'),
